function NotFound() {
  return (
    <div className="card" style={{ textAlign: 'center', padding: '40px' }}>
      <h2 className="form-title">404 - Page Not Found</h2>
      <p>Sorry, the page you are looking for does not exist.</p>
    </div>
  );
}

export default NotFound;
